import React from "react";
import {isAuth} from "./paths/helpers"
import {BrowserRouter, Switch, Route} from "react-router-dom";
import Navbar from "./navbar";
import Activate from "./paths/activate";
import landingPage from "./paths/landingPage";
import Signin from "./paths/signin";
import home from "./paths/home";
import Signup from "./paths/signup";


function Router() {
    return <BrowserRouter>

            <Switch>
                <Route    component={isAuth() ? home : landingPage} exact path="/" />
               
                <Route component={Signin} exact path="/signin" />
                <Route component={Signup} exact path="/signup"/>
                <Route component={Activate} exact path="/auth/activate/:token" />
            </Switch>
    </BrowserRouter>
}

export default Router;
